	SET @statement = CONCAT('SELECT COUNT(*) into @statement_result FROM information_schema.COLUMNS WHERE TABLE_SCHEMA =  \'',schema_n,'\' AND TABLE_NAME =  \'',tbl,'\' AND COLUMN_NAME =  \'',col_name,'\';');
    
